import React from "react";
import Wallpaper from "../commonwallpaper/Wallpaper";
import Footer from "../sign-In/Footer";
import netflixlogo from "../../assets/netflix-logos-idcIWizlPG.png";
import Dropdown from "../commonwallpaper/Dropdown";
import "./SignUp.scss";
import SignUpBody from "./SignUpBody";

function SignUp() {
  return (
    <div> 
    <div
      className="flex bg-black bg-opacity-100 overflow-hidden"
      style={{ backgroundColor: "#000" }}
    >
      <div class="absolute flex w-full flex justify-around">
        <div>
          {" "}
          <img
            className="img-logo1"
            src={netflixlogo}
            alt="netflix-logo"
            style={{ color: "red" }}
          />{" "}
        </div>
        <div class="pt-5 flex gap-20">
          {" "}
          <div style={{ color: "white", border: "solid", height:"56px" }}>
            {" "}
            <Dropdown />
          </div>
          <div
            class=" text-center lg:text-left "

          >
         <button class=" h-10 bg-red-700 hover:bg-red-700 text-white font-bold py-2 px-4 rounded mr-0.75">
  Sign In
</button>
          </div>{" "}

        </div>

      </div>


      <div>
        <Wallpaper />
      </div>


      <div>
        <Footer />
      </div>

    </div>
    </div>
  );
}

export default SignUp;
